function x20082_OnQuestInit(MapID, InstanceID, QuestID, OwnerID, NPCID)

	--
	local LoopNum = role.GetRoleScriptData(OwnerID, 1, RoleDataType["WeiDao"])
	local RoleLvl = role.GetRoleLevel(MapID, InstanceID, OwnerID)

	if LoopNum==100 or LoopNum==200 or LoopNum==300 then
		role.AddRoleItem(MapID, InstanceID, OwnerID, 3200326, 1, -1, 8, 102)
	end

	local Index = weidao_rand_func(LoopNum, RoleLvl)

	role.SetRoleScriptData(OwnerID, 1, RoleDataType["WeiDao_Index"], Index)

	--
	role.QuestInit(OwnerID, QuestID, GetRandQuestTable(Quest_WeiDao, Index))

	--
	local MsgID = msg.BeginMsgEvent()
	msg.AddMsgEvent(MsgID, 11, QuestID)
	msg.AddMsgEvent(MsgID, 10, LoopNum)
	msg.AddMsgEvent(MsgID, 1, Quest_WeiDao[Index].MsgID)
	msg.DispatchRoleMsgEvent(OwnerID, MsgID)
end

