function x20082_OnCheckAccept(MapID, InstanceID, QuestID, RoleID, NPCID)



	--
	local LoopNum = role.GetRoleScriptData(RoleID, 1, RoleDataType["WeiDao"])

	--

	if LoopNum==100 or LoopNum==200 or LoopNum==300 then
		local FreeSize = role.GetBagFreeSize(RoleID)
		if(FreeSize < 1) then
			local MsgID = msg.BeginMsgEvent()
			msg.AddMsgEvent(MsgID, 26, 141)
			msg.DispatchRoleMsgEvent(RoleID, MsgID)
			return 0
		end
	end

	--0301
	if 0 == LoopNum or LoopNum>300 then
		LoopNum = 1
		role.SetRoleScriptData(RoleID, 1, RoleDataType["WeiDao"], LoopNum)
	end

	return 1
end

