function I3200326_CanUse(MapID, InstanceID, TypeID, TargetID)

	--
	if role.IsRoleHaveQuest(MapID, InstanceID, TargetID, 20082)==false then
		return 32, false
	end

	local Index = role.GetRoleScriptData(TargetID, 1, RoleDataType["WeiDao"])
	if Index~=100 and (Index~=200 and Index~=300) then
		return 32, false
 	end


	--
	local CanUse = WeiDao_EnterNearArea(MapID, InstanceID, TargetID)
	--
	if CanUse ~= true then
		Index = role.GetRoleScriptData(TargetID, 1, RoleDataType["WeiDao_Index"])
	    local MsgID = msg.BeginMsgEvent()
	    msg.AddMsgEvent(MsgID, 13, 0)
	    msg.AddMsgEvent(MsgID, 1, 256)
	    msg.AddMsgEvent(MsgID, 6, Quest_WeiDao_Pos[Index].MapCrc)
	    msg.AddMsgEvent(MsgID, 9, Quest_WeiDao_Pos[Index].x)
	    msg.AddMsgEvent(MsgID, 9, Quest_WeiDao_Pos[Index].z)
	    msg.DispatchRoleMsgEvent(TargetID, MsgID)

	    local MsgID1 = msg.BeginMsgEvent()
	    msg.AddMsgEvent(MsgID1, 26, 256)
	    msg.AddMsgEvent(MsgID1, 6, Quest_WeiDao_Pos[Index].MapCrc)
	    msg.AddMsgEvent(MsgID1, 9, Quest_WeiDao_Pos[Index].x)
	    msg.AddMsgEvent(MsgID1, 9, Quest_WeiDao_Pos[Index].z)
	    msg.DispatchRoleMsgEvent(TargetID, MsgID1)
	    return 36, false
    else
        return 0, false
	end
end

function I3200326_Use(MapID, InstanceID, TypeID, TargetID)
	local x, y ,z = unit.GetPosition(MapID, InstanceID, TargetID)
	local Index = role.GetRoleScriptData(TargetID, 1, RoleDataType["WeiDao_Index"])

	map.MapCreateColCreature(MapID, InstanceID, Quest_WeiDao[Index].TargetID1, x+2, y, z+2,1)
end

aux.RegisterItemEvent(3200326, 0, "I3200326_CanUse")
aux.RegisterItemEvent(3200326, 1, "I3200326_Use")
